import axios from "axios"
import { BaseUrl } from "../shared/BaseUrl"
import { myHeaders } from "../shared/MyHeaders"

export async function getAllDataRoomHistory() {
    try {
        const response = await axios.get(`${BaseUrl}/roomhistories?page=0&size=5`
            , { headers: myHeaders })
        return response
    } catch (error) {
        console.log(error);
    }
}
